import { useEffect, useState } from 'react'
import { getProfile } from '../actions/auth'
import { motion } from 'framer-motion'
import { FileIcon, UploadIcon, FolderIcon, TrashIcon, LogOutIcon } from 'lucide-react'


const Dashboard = () => {
  useEffect(() => {
    const token = localStorage.getItem('access_token')
    if (!token) {
      window.location.href = '/'
    }
    (async () => {
      const profile = await getProfile();

      if (profile.error) {
        alert(profile.error);
        return;
      }

    })()
  }, []);

  const [files, setFiles] = useState([
    { id: 1, name: 'Project Proposal.pdf', size: '2.5 MB', shared: '2 days ago' },
    { id: 2, name: 'Financial Report Q2.xlsx', size: '1.8 MB', shared: '1 week ago' },
    { id: 3, name: 'Team Photo.jpg', size: '4.2 MB', shared: '3 hours ago' },
  ])

  const [dragActive, setDragActive] = useState(false)

  const handleDrag = (e) => {
    e.preventDefault()
    e.stopPropagation()
    if (e.type === 'dragenter' || e.type === 'dragover') {
      setDragActive(true)
    } else if (e.type === 'dragleave') {
      setDragActive(false)
    }
  }

  const handleDrop = (e) => {
    e.preventDefault()
    e.stopPropagation()
    setDragActive(false)
    if (e.dataTransfer.files && e.dataTransfer.files[0]) {
      // Handle file upload here
      console.log("File(s) dropped")
    }
  }

  const handleFileInput = (e) => {
    if (e.target.files && e.target.files[0]) {
      // Handle file upload here
      console.log("File(s) selected")
    }
  }
  return (

    <div className="min-h-screen bg-gray-100">
      <nav className="bg-white shadow-sm">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between h-16">
            <div className="flex">
              <div className="flex-shrink-0 flex items-center">
                <FolderIcon className="h-8 w-8 text-indigo-600" />
                <span className="ml-2 text-2xl font-bold text-indigo-600">FileFlow</span>
              </div>
            </div>
            <div className="flex items-center">
              <button className="ml-3 inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500">
                <LogOutIcon className="h-5 w-5 mr-2" />
                Logout
              </button>
            </div>
          </div>
        </div>
      </nav>

      <main className="max-w-7xl mx-auto py-6 sm:px-6 lg:px-8">
        <div className="px-4 py-6 sm:px-0">
          <h1 className="text-3xl font-bold text-gray-900 mb-6">Your Files</h1>

          <motion.div
            className={`p-8 mt-4 border-2 border-dashed rounded-lg ${dragActive ? 'border-indigo-600 bg-indigo-50' : 'border-gray-300'
              }`}
            onDragEnter={handleDrag}
            onDragLeave={handleDrag}
            onDragOver={handleDrag}
            onDrop={handleDrop}
            whileHover={{ scale: 1.01 }}
            transition={{ type: 'spring', stiffness: 300, damping: 20 }}
          >
            <div className="text-center">
              <UploadIcon className="mx-auto h-12 w-12 text-gray-400" />
              <p className="mt-1 text-sm text-gray-600">
                Drag and drop your files here, or
                <label
                  htmlFor="file-upload"
                  className="relative cursor-pointer bg-white rounded-md font-medium text-indigo-600 hover:text-indigo-500 focus-within:outline-none focus-within:ring-2 focus-within:ring-offset-2 focus-within:ring-indigo-500 ml-1"
                >
                  <span>select a file</span>
                  <input
                    id="file-upload"
                    name="file-upload"
                    type="file"
                    className="sr-only"
                    onChange={handleFileInput}
                  />
                </label>
              </p>
              <p className="mt-1 text-xs text-gray-500">PNG, JPG, GIF up to 10MB</p>
            </div>
          </motion.div>

          <div className="mt-8">
            <h2 className="text-xl font-semibold text-gray-900 mb-4">Shared Files</h2>
            <div className="bg-white shadow overflow-hidden sm:rounded-md">
              <ul className="divide-y divide-gray-200">
                {files.map((file) => (
                  <motion.li
                    key={file.id}
                    whileHover={{ backgroundColor: '#F9FAFB' }}
                  >
                    <div className="px-4 py-4 flex items-center sm:px-6">
                      <div className="min-w-0 flex-1 sm:flex sm:items-center sm:justify-between">
                        <div className="flex items-center">
                          <FileIcon className="flex-shrink-0 h-6 w-6 text-indigo-600" />
                          <div className="ml-4">
                            <p className="font-medium text-indigo-600 truncate">{file.name}</p>
                            <p className="mt-1 text-sm text-gray-500">
                              {file.size} · Shared {file.shared}
                            </p>
                          </div>
                        </div>
                      </div>
                      <div className="ml-5 flex-shrink-0">
                        <button className="p-2 text-gray-400 hover:text-gray-500">
                          <TrashIcon className="h-5 w-5" />
                        </button>
                      </div>
                    </div>
                  </motion.li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      </main>
    </div>)
}

export default Dashboard
